import { createIcon } from "../icon/createIcon";

export const AppSwitcherIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="AppSwitcherIcon">
    <path d="M7.5 9v3h-3V9h3zM12 9v3H9V9h3zM3 9v3H0V9h3zm0-4.5v3H0v-3h3zm9 0v3H9v-3h3zm-4.5 0v3h-3v-3h3zM3 0v3H0V0h3zm4.5 0v3h-3V0h3zM12 0v3H9V0h3z" />
  </svg>,
  "AppSwitcher",
  "app switcher"
);
